import React from 'react';

function Header_k() {
    return (
        <div>
            <h2>Kelena Dalam</h2>
            <nav className='head_nav'>
                <a href="/html/">HTML</a>
                <a href="/css/">CSS</a>
                <a href="/js/">JavaScript</a>
                <a href="/python/">Python</a>
            </nav>
        </div>
    )
}

export default Header_k
